import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different wait strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });
    await page.waitForSelector('body', { timeout: 10000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if any modal is visible by default
    const modalVisible = await page.evaluate(() => {
      const modal = document.querySelector('.modal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    });

    // If no modal is open, trigger one to open by clicking a product
    if (!modalVisible) {
      await page.waitForSelector('.product-card', { timeout: 5000 });
      await page.click('.product-card:first-child');
      await page.waitForSelector('.modal', { state: 'visible', timeout: 5000 });
    }

    // Take screenshot of open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for modal to be hidden
    await page.waitForSelector('.modal', { state: 'hidden', timeout: 5000 });

    // Take screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Verify modal is closed
    const modalClosed = await page.evaluate(() => {
      const modal = document.querySelector('.modal');
      return !modal || window.getComputedStyle(modal).display === 'none';
    });

    return {
      success: true,
      action: "Closed modal using Escape key",
      extractedData: {
        modalClosed: modalClosed
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
